  padding-top: 10px;
  padding-left: 10px;
  padding-right: 10px;
`;

function Slogan_Domain() {
  return (
    <SloganDomainBlock>
      <p>EndLess Creation</p>
    </SloganDomainBlock>
  );
}

export default Slogan_Domain;
